import React, { useState } from 'react'

export const LinkForm = () => {

    const handleSubmit = e => {

        const initialStateValues = {
            url: '',
            name: '',
            description: ''
        }

        const [values, setValues] = useState(initialStateValues)

        e.preventDefault();
        console.log(values);
    }

    return (
        <form className="card card-body" onSubmit={handleSubmit}>
            <div className="form-group input-group">
                <div className="input-group-text bg-light">
                    <i className="material-icons">insert_link</i>
                </div>
                <input type="text" className="form-control" placeholder="https://someurl.com" name="url" id=""/>
            </div>
            <div className="form-group input-group">
                <div className="input-group-text bg-light">
                    <i className="material-icons">create</i>
                </div>
                <input type="text" className="form-control" placeholder="Website name" name="name" id=""/>
            </div>
            <div className="form-group input-group">
                <textarea name="description" placeholder="Website description" className="form-control" id="" rows="3"></textarea>
            </div>
            <button type="submit" className="btn btn-primary btn-block">Save</button>
        </form>
    );
}

export default LinkForm;
